import './index.scss';
import { useEffect, useRef } from 'react';
import DrawSVGPlugin from 'gsap-trial/DrawSVGPlugin';
import gsap from 'gsap-trial';
import LogoOutline from '../../../assets/images/Logo3d.svg'

const Logo = () => {

    const outlineLogoRef = useRef(LogoOutline)
    const didAnimate = useRef(false)

    useEffect(() => {
        if (didAnimate.current) return
        didAnimate.current = true
        gsap.registerPlugin(DrawSVGPlugin)

        gsap.timeline()
            .from(outlineLogoRef.current, {
                drawSVG: 0,
                duration: 20,
            })

    }, [])

    return (
        <div className="logo-container" ref={outlineLogoRef}>

            <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 500 900" overflow="hidden" width="500" height="900">
                <defs>
                    <clipPath id="a">
                        <path d="M0 0h500v900H0z" class="svg-elem-1"></path>
                    </clipPath>
                </defs>
                <g fill="rgb(186 186 186)" stroke="rgb(36 123 160)" stroke-width="5" stroke-linecap="round" stroke-dasharray="0">
                    <path d="M40 10.95v800m370-800h-80m140 40v800M180 270.474l210 580.475m-290 .001h80m210 0h80m-79.746-800h80M180 850.95V270.475M390 630V50.95m0 0-60-40m80 0 60 40m-430 760 60 40m290.258-.002-60.254-39.616m-.004-.382L180 397.307M100 50.95v800m80-800L390 630M330 10.95v449.948M100 50.95h80m-60-40 60 40m-140-40 60 40m-60-40h80" class="svg-elem-2"></path>
                </g>
            </svg>

        </div>
    )
}

export default Logo;
